const root = ReactDOM.createRoot(document.getElementById('root'));
function Navbar()
{
  return(
    <div>
    <ul>
      <li><a href="#">Home</a></li>
      <li><a href="#">product</a></li>
      <li><a href="#">contact</a></li>
    </ul>
    </div>
  )
}
function Aboutus()
{
 return(
  <div>
  <h1>About us</h1>
  <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. At illum nisi magnam ipsam, quia laudantium omnis, dolores voluptas iusto doloremque rerum, error porro aperiam recusandae et. Praesentium dolorem atque odit!</p>
  </div>
 )
}
root.render(
<div>
  <Navbar></Navbar>
  <Aboutus></Aboutus>


</div>
);
